import React from 'react'
import ProductCard from '../ProductCard/ProductCard'
import s from './ProductsContainer.module.css'

export default function ProductsContainer() {

    const productsData = [
        {
            id: 1,
            title: 'Apple',
            price: 500,
        },
        {
            id: 2,
            title: 'Banana',
            price: 300,
        },
        {
            id: 3,
            title: 'Orange',
            price: 400,
        },
        {
            id: 4,
            title: 'Pineapple',
            price: 600,
        },
        {
            id: 5,
            title: 'Mango',
            price: 700,
        },
        {
            id: 6,
            title: 'Grapes',
            price: 250,
        },
    ];

    return (
        <div className={s.ProductsContainer}>ProductsContainer
            {
                productsData.map(el => <ProductCard key={el.id} {...el} />)
            }
        </div>
    )
}
